import { link } from "fs";
import React from "react";

const Todos: React.FC<{items: string[]}> = (props) => {
  return (
    <>
      <ul>
        {props.items.map(item => <li key={item.id}>(item)</li>)}
      </ul>
    </>
  )
}

export default Todos;
